import React from 'react'
import { Typography,Container } from '@material-ui/core'

export default function ProductsPage(){
    return(
        <React.Fragment>
            <Container fixed>
                <Typography component="div" style={{ backgroundColor: '#cfe8fc', height: '100vh' }} />
            </Container>
        </React.Fragment>
    )
}
